    <style>
    .hwa_banner{
    max-width: 99rem;
    max-height: 34rem;
    flex-shrink: 0;
    width: 100%;
    height: 100%;
   
    position: relative;
    overflow: hidden;
    border-radius: 2rem;
    
    transition: transform 0.5s ease;
}
.banner_bcg{

    background: #0BAA7A;
    
    width: 100%;
    height: 34rem;
    display: block;
}
.banner_svg{
    position: absolute;
    
    top: 0;
}
.banner_gradient{
    background: linear-gradient(110deg, rgba(3, 181, 145, 0.00) 0.75%, #03B585 24.11%, #04B68B 74.85%, rgba(4, 182, 134, 0.00) 102.63%);
    position: absolute;
    
    top: 0;
    width: 100%;
    height: 100%;
}

.hero{
    position: absolute;
    top: 0;
    
    width: 99%;
    height: auto;
    margin-top: 1rem;
    text-align: right;
}




.img-and-content-holder{
    position: absolute;
    top: 0;
    width: 100%;
    height: 100%;
    display: flex;
    flex: auto 1 auto;
    gap: .5rem;
    

}



.banner_img{
    background-image: url("https://assets.phenompeople.com/CareerConnectResources/prod/CNEXEMEA/images/heroimage-1698105476156.png");
    position: absolute;
    width: 100%;
    height: 34rem;
    bottom:  0;
    padding-left: 33%;
    padding-right: 33%;
    background-size: contain; /* Scale the background image to cover the container */
    background-repeat: no-repeat; /* Prevent the background image from repeating */
    background-position: center; /* Center the background image */
}
.text_right,
.text_left{
    color: #FFF;
    font-family: 'GTAmerica-Bold';
    font-size: 3.83rem;
    font-style: normal;
    font-weight: 700;
    line-height: normal;
    width: 100%;

    
}
.placeholder_for_img{
    width: 100%;
}
